import React from 'react';
import { render } from 'react-dom';
import App from './App';
import 'normalize.css';
import { GlobalStyles } from './global-styles';
import useAuth, {AuthProvider} from './helpers/useAuth';


render(
    <React.StrictMode>
        <AuthProvider>
        <GlobalStyles/>
        <App />
        </AuthProvider>
    </React.StrictMode>,
    document.getElementById('root')
);
